  <script>
  const areaToLines ={
    'area-2' : ['line-area-2', 'line-area-2-9'],
    'area-3' : ['line-area-3', 'line-area-3-9'],
    'area-4' : ['line-area-4', 'line-area-4-9'],
    'area-6' : ['line-area-6', 'line-area-6-9'],
    'area-7' : ['line-area-7', 'line-area-7-9'],
    'area-8' : ['line-area-8', 'line-area-8-9'],
    'area-9' : ['line-area-9', 'line-area-9-9'],
  };
  Object.entries(areaToLines).forEach(([areaId, lineClasses]) => {
    const areaEl = document.getElementById(areaId);
    if (!areaEl) return;

    areaEl.addEventListener('mouseenter', () => {
      lineClasses.forEach(cls => {
        document.querySelectorAll(`.${cls}`).forEach(line => {
          line.classList.remove('grayscale', 'stroke-gray-400');
        });
      });
    });

    areaEl.addEventListener('mouseleave', () => {
      lineClasses.forEach(cls => {
        document.querySelectorAll(`.${cls}`).forEach(line => {
          line.classList.add('grayscale');
          line.classList.remove('stroke-sky-500');
        });
      });
    });
  });
  document.querySelectorAll('[id^="area-"]').forEach(area => {
    area.addEventListener('mouseenter', () => {
      document.querySelectorAll('.line-path').forEach(path => {
        path.classList.remove('stroke-gray-400');
      });
    });
    area.addEventListener('mouseleave', () => {
      document.querySelectorAll('.line-path').forEach(path => {
        path.classList.remove('stroke-sky-500');
      });
    });
  });

  const areas = ['logo','area-1', 'area-2', 'area-3', 'area-4','area-5','area-6', 'area-7', 'area-8', 'area-9', 'area-10', 'area-11', 'area-12']
  
  areas.forEach(id => {
    const el = document.getElementById(id);
    if (!el) return;

    el.addEventListener('mouseenter', () => {
      document.querySelectorAll(`.line-${id}`).forEach(line => line.classList.remove('grayscale'));
    });

    el.addEventListener('mouseleave', () => {
      document.querySelectorAll(`.line-${id}`).forEach(line => line.classList.add('grayscale'));
    });
  });

  // area index list and image
  window.addEventListener('message', (event)=> {
    if (!event.data || !event.data.type) return;

    const{type, area}= event.data;
    const el =document.getElementById('area-' + area);
    if (!el) return;

    if(type === 'hover') {
      el.dispatchEvent(new Event('mouseenter'));
    } else if (type === 'leave') {
      el.dispatchEvent(new Event('mouseleave'));
    }
  });

    // Kirim ke parent saat cursor masuk / keluar area
  for (let i = 1; i <= 14; i++) {
    const el = document.getElementById('area-' + i);
    if (!el) continue;

    el.addEventListener('mouseenter', () => {
      window.parent.postMessage({ type: 'highlight', area: i }, '*');
    });

    el.addEventListener('mouseleave', () => {
      window.parent.postMessage({ type: 'unhighlight', area: i }, '*');
    });
  }

  // Menerima hover dari parent
  window.addEventListener('message', (event) => {
    const { type, area } = event.data || {};
    const el = document.getElementById('area-' + area);
    if (!el) return;

    if (type === 'hover') {
      el.dispatchEvent(new Event('mouseenter'));
    } else if (type === 'leave') {
      el.dispatchEvent(new Event('mouseleave'));
    }
  });
